import { HttpClientModule } from '@angular/common/http';
import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { WelcomePageComponent } from './componentes/welcome-page/directory/welcome-page.component';

import { HospitalModule } from './componentes/hospital/hospital.module';
import { SpecialityModule } from './componentes/speciality/speciality.module';
import { MenuMainComponent } from './componentes/menu-main/menu-main.component';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import {MatTabsModule} from '@angular/material/tabs';

@NgModule({
  declarations: [
    AppComponent,
    WelcomePageComponent,
    MenuMainComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    MatTabsModule,
    HospitalModule,
    SpecialityModule,
    BrowserAnimationsModule,
    MenuMainComponent
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
